The issue we found out today morning of having wrong number of zero's in the time stamp was fixed & now we have 4 zeros in the time stamp for the events. 
While testing for this fix I found that we do not get any install events but we see avg session lengths for BB.

Verifying on rightscale shows us the enroll event & the start event as it normally should .

